    false,nt"url": null,nt"notes": "This is a polygon coverage and shapefile
    that contains undivided Upper Cretaceous rocks that include (in descending order)
    the Smoky Hollow and Tibbet Canyon Mbs. of the Straight Cliffs Fm., and the Tropic
    Shale and Dakota Fm. This coverage shows where these rocks are exposed along the
    outcrop and are buried in the subsurface in the Kaiparowits Plateau study area,
    southern Utah. The base of the Dakota Fm. was used to define the Kaiparowits Plateau
    for areas east of 112 degrees of longitude. The northern boundary is delineated
    by the Paunsaugunt fault and volcanic rocks of Tertiary age.",nt"license_title":
